import './App.css';
import logo from './logo.svg';

function App() {

  const excelData =[
    {
      "First Name": "aminul",
      "Last Name": "Islam",
      "Employee Id": "001",
      "Dob": "10-12-2000",
      "Phone": "01845678921"
    },
    {
      "First Name": "jalil",
      "Last Name": "khondok",
      "Employee Id": "002",
      "Dob": "10-12-2001",
      "Phone": "01845678921"
    },
    {
      "First Name": "muaaz",
      "Last Name": "Islam",
      "Employee Id": "003",
      "Dob": "10-12-2004",
      "Phone": "01845678921"
    },
    {
      "First Name": "aminul",
      "Last Name": "Islam",
      "Employee Id": "001",
      "Dob": "10-12-2000",
      "Phone": "01845678921"
    }
  ]
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
